', '-', '<p>＜本人にとってよいこと＞</p><p>・「正しく」書くではなく「楽しく」書くから気楽に参加できる。</p><p>・見本を真似て書くのってそれだけで楽しい。</p><p>・カラーの筆ペンがあるって知らなかった！色で明るくなる！</p><p>・書いたものは自分の部屋に飾れる。</p><p>・周りの方や家族、友人にプレゼントすると「え？これ書いたの？」と喜ばれる。</p><p>・自分で書いたものが「こんなに喜ばれる！」という感動を体験できる。</p><p>・誰かを想って書くのって楽しい！また書いて渡したくなる！</p><p>・みんな違ってみんないいから気軽に描いて楽しめる。</p><p>・自由時間に自分で好きに描くことができる。</p><p><br></p><p>＜介護施設＞</p><p>・施設の壁に貼ることで春夏秋冬の季節感を演出できる。</p><p>・手書きの魅力やあたたかさを皆で鑑賞することができる。</p><p>（書き初めをしてお正月感を出すこともできますよ）</p><p>・筆ペンは手間いらず。硯（すずり）も不要、墨をすったりする必要もありません。</p><p>・筆ペンは水性。手に少しつくことがあってもいずれとれるので安心。</p><p>・机の上には新聞紙を敷いておくと安心。</p><p>・紙はＡ４のコピー用紙でＯＫ。</p><p>・メール送信する見本を印刷いただくことで郵送料を節約できる。</p>', '2021-11-28 15:05:05.039504', '2021-11-28 15:05:05.039504', 'O4lE0K37bOI', 0, 'blue', '{23}', 13500, 0, 3200, 6, 10000, NULL, 't', 'E14', 't', 1292, '増田玲子', '伝筆協会認定講師', '想いを筆文字にのせる楽しさに惹かれ、伝筆（つてふで）協会認定講師として活動中。2020年3月より講座をオンライン化。手書きのあたたかさを共有することを大事にしながら現在まで125回以上のオンライン講座を実施。他にコーチング研修講師やパーソナルコーチをしている。', NULL, 't'),
