5分 終わりの挨拶"', 'なし', 'なし', '<p><span style="color: rgb(44, 62, 80);">自己紹介：</span></p><p><span style="color: rgb(44, 62, 80);">竹口 耕輔（竹口亭 ホワイトボード）と申します。</span></p><p><span style="color: rgb(44, 62, 80);">長崎県のデイサービスで理学療法士として就労しているかたわら、ホワイトボード落語アーティスト、役者（コント・演劇・一人芝居）、筆書きのボランティア活動をさせていただいています。</span></p><p><br></p><p><span style="color: rgb(44, 62, 80);">以下、「竹口亭 ホワイトボード」名義で披露させていただいている「ホワイトボード落語」について説明させていただきます。</span></p><p><br></p><p><span style="color: rgb(44, 62, 80);">ホワイトボードに物語の登場人物やあらすじを書き、その他 小道具を使うことで、視覚的アプローチを存分に活かした世界初のオリジナル落語「ホワイトボード落語」を独自に編み出しました。</span></p><p><span style="color: rgb(44, 62, 80);">現役の理学療法士として長崎県のデイサービスに就労していると、現場で利用者様から毎日のように「家にいると何もすることがない」「歳をとって自由に外出できないし、笑う機会が減った」とのお声を拝聴していました。</span></p><p><span style="color: rgb(44, 62, 80);">なので前述の役者の経験を活かし、何か利用者様のお役に立てないかと思い立ったのが「高齢の方々が好みそうな落語を独学で習得し、披露する」ということでした。</span></p><p><br></p><p><span style="color: rgb(44, 62, 80);">そこから、人間の五感使用率のうち86%を占める「視覚」からのアプローチを多用することで更に利用者様に「話が非常に分かりやすい」落語を提供でき、他施設や複合商業施設でのストリート落語、サロン、お祭り、はたまた自身のFacebookライブ等で頻繁に披露しています。</span></p><p><br></p><p><span style="color: rgb(44, 62, 80);">2021年1月にはNPO法人タダカヨ 様からのお誘いをいただき、「第１回 無料オンライン落語会」に出演させていただき、全国68施設、推定800名の方々に「ホワイトボード落語」を楽しんでいただきました。</span></p><p><br></p><p><span style="color: rgb(44, 62, 80);">僭越ながら長崎ケーブルメディア 様に製作していただいた約20分の特集映像「竹口亭 ホワイトボードと申します」は、全国のケーブルテレビ様やJ:COM 様で放送していただき、放送回数は40回を突破。初回放送から１年３ヶ月を超えて日本全国の多くの皆様にご覧いただきました。</span></p><p><br></p><p><span style="color: rgb(44, 62, 80);">これからも「究極に分かりやすい落語」を追求し、お人様の喜びとなれるよう精進して参ります。</span></p><p><br></p><p><span style="color: rgb(44, 62, 80);">リンク：</span></p><p><a href="https://take19881002ko.wixsite.com/takeguchiwhiteboard" rel="noopener noreferrer" target="_blank" style="background-color: rgb(255, 255, 255); color: rgb(0, 188, 212);">https://take19881002ko.wixsite.com/takeguchiwhiteboard</a></p>', '2021-11-28 15:05:06.33679', '2021-11-28 15:05:06.33679', 'zRAWfBD2QyI', 0, 'blue', '{23}', 2000, 0, 0, 30, 0, NULL, 't', 'E17', 't', 1296, '竹口亭ホワイトボード', 'ー', '施設の皆様の喜びと健康のために、「竹