(149, '飴細工実演', '昔懐かしい飴細工。飴のプレゼントあり！', 60, '一昔前までお祭りの屋台などで定番だった飴細工。そんな昔懐かしの飴細工を、プロの飴細工師が、皆様の目の前で華麗に実演します！飴細工一筋30年の職人の技にうっとり魅了されること間違いなし。皆様のリクエストに合わせて、お好きなキャラクターなども作ります。作った飴をお持ち帰りいただくこともできるので、夏祭りや敬老会、ご家族や地域の方を招いての大型イベント時におすすめです。昔懐かしい時間をお楽しみください。', '60分：実演開始(リクエスト分含む)
