(151, 'エンターテイメントマジックショー', '夢と希望とファンタジーの世界へ', 40, '若手実力派プロマジシャンによる「夢と希望とファンタジー」がテーマのエンターテイメントマジックショー。皆様の目と鼻の先、まさに至近距離で、数々の奇跡を起こします。キレキレの技で皆様をあっと驚かせて、高齢者の方も親しみやすい朗らかな人柄と巧みな話術で皆様を笑顔にします。ロマンチックな魔法の疑似体験としてのマジックの楽しさや面白さを感じていただくことができる、不思議や感動に満ちた時間。', '40分：プログラム
