(152, '昭和を駆け抜けたクルマたち展', 'クルマとの思い出を聴かせて下さい！', 45, '当日持ち込む懐かしいクルマカタログを額装したパネルを飾り、パソコンを使ってプロジェクターに沢山のクルマのカタログや写真をお見せします。当時の流行などもそのカタログから追いつつ、施設の皆さんへお話を振ったり、クイズを出しながら昔の記憶を一緒に辿る回想のお手伝いをさせていただきます。', '①挨拶（５分）、②展示作品の紹介・クイズ（１５分）、③施設の皆様からのクルマとの思い出話を聴く（１５分）、④終わりの挨拶＋お別れの動画（１０分）', '駐車場, プロジェクター、絵画展示出来るスペース', '-', '<p>趣味で集めた戦前～高度成長期の国産自動車カタログ（１０００冊超）や、現代に残るクルマの風景写真を使って皆さんをあの時代に誘（いざな）います。昔のカタログは今と違い写真ではなく手書き絵や、人間味溢れたデザインをしたものが多く、見ていると心が楽しい気持ちになります。今まで老人ホームや病院、美術館等でカタログ展示など開催し、新聞等でも紹介されました。</p><p><br></p><p>過去の経験で、仕事一筋でやってきた高齢者は施設の中で上手くコミュニケーションが取れない方がいました。私が昔のクルマについて紹介していると、当時を思い出したのか堰を切ったように喋り出した方が何名かいらっしゃいました。そういった回想のお手伝いを微力ながらさせていただきます。</p>', '2021-11-28 15:06:25.351803', '2021-11-28 15:06:25.351803', '', 0, 'orange', '{11,12,13,14}', 2700, 0, 0, 20, 2000, NULL, 't', 'E07', 'f', 1571, 'ナビゲーター☆エコー', '回想案内人', '私が話を一方的にすることはせず、皆さんから沢山話をしてもらうことを重要視しています。今ご高齢の方も当時は家庭や仕事でクルマと接したに違いありません。是非皆さんからクルマとの思い出話を聴かせて下さい。', NULL, 't'),
