(190, 'スイーツビュッフェ', '空間演出で華やかに、選んで食べるスイーツビュッフェ', 60, '見ているだけでも心が躍る、トキメキ溢れるスイーツビュッフェです。選んで食べれるビュッフェはもちろん、季節のイメージで空間演出プロが会場を華やかに彩ります。高齢者の方向けに、糖質控えめや糖尿病の方でも食べられるスイーツなど、栄養学を学んだからこそ提供できるオリジナルメニューも作成できます。スイーツ作りを通して人々の笑顔を創りだしていけたらなと思っています。', '20分前会場入り
