10分片付け', 'お湯沸かし,シンク,スプーン＆フォーク,ソーサー,ティーカップ,冷蔵庫,果物ナイフ＆まな板', 'キッチンクロス,ビニール手袋,台ふきん,材料,消毒液', '<p>内容によって金額が異なります。</p>', '2021-11-28 15:06:31.086046', '2021-11-28 15:06:31.086046', '', 0, 'orange', '{23}', 27000, 2500, 1500, 20, 20000, NULL, 't', 'E06', 'f', 1587, '大橋まき', 'スイーツヒーロー', '高校の家庭科講師をつとめながら自宅サロンにて、お菓子教室を始める。たちまち人気教室になり、全国でお客さんが集まるように。テレビや各種イベントでも作品を提供するなど多彩な活動を展開中。書籍「萌子のDECOスイーツ」出版。', NULL, 't'),
(191, '季節のお菓子教室', '季節のお勧めorリクエストに合わせたお菓子作りを楽しむ講座です。', 60, 'カップケーキ、タルト、シフォンケーキ、ムースなど、人気の洋菓子が基本から習えるケーキ教室自身で作ると一段と美味しく感じられるものです。ぜひ、みなさんご参加ください。', '40分制作,
