マイク(必要な広い会場であれば)', '座布団', '<p>プロフィール</p><p>平成１６年、春風亭小朝、笑福亭鶴瓶、立川志の輔、春風亭昇太、林家正蔵、柳家花緑、からなる『六人の会』主催、『第１回・全国落語台本コンクール』にて、１０４８本の新作落語台本の中から、自作『身投げ橋』が最優秀賞を獲得。以来、春風亭小朝、春風亭昇太、立川志の輔、林家正蔵、林家木久蔵、林家三平、桂かい枝など、プロの落語家に定期的に落語台本を提供する作家活動のかたわら、自らも年間２５０回に及ぶ高座に上がり続け、平成２１年８月には、大阪池田市で行われた『社会人落語日本一決定戦』において、３６２名の社会人落語家の中から、３位入賞を果たし、翌年は奨励賞、平成２５年には藤本義一賞を 受賞。</p><p>近年は『悪質商法撃退落語』『振り込め詐欺撃退落語』『認知症落語』『成年後見制度落語』『相続・終活落語』『納税推奨落語』『子育て応援落語』『中高年応援落語』『男女共同参画落語』『交通安全推奨落語』『商店街落語』『投票呼びかけ落語』など、テーマに応じた創作落語を作って演じ、その啓発に一役買っている。</p><p><br></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">またエフエムとよたにて【ラブィート演芸　楽市・落語】のパーソナリティを務めている。日曜日午後５時～５時半(隔週担当)放送中！</span></p><p><br></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">（受賞歴）</span></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">平成１６年　第１回全国落語台本コンクール　最優秀賞受賞</span></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">平成２０年　落語協会台本コンクール　佳作受賞</span></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">平成２１年　国立演芸場・漫才台本コンクール　最優秀賞受賞</span></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">平成２４年　落語協会台本コンクール　優秀賞受賞</span></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">平成２５年　上方落語協会台本コンクール　佳作受賞</span></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">平成２６年　上方落語協会台本コンクール　佳作受賞（２年連続）</span></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">平成２７年　落語協会台本コンクール　最優秀賞受賞</span></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">平成２８年　落語協会台本コンクール　優秀賞受賞(２年連続)</span></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">平成２９年　落語協会台本コンクール　最優秀賞受賞(３年連続)</span></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">平成３０年　落語協会台本コンクール　優秀賞受賞(４年連続)</span></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">令和元年　落語協会台本コンクール　優秀賞受賞(５年連続)</span></p><p><br></p><p><br></p><p><span class="ql-font-monospace" style="color: rgb(0, 0, 0);">平成２１年　社会人落語日本一決定戦　３位入賞</span></p><p><span class="ql-font-monospac